import React from "react";
import { JsonToTable } from "react-json-to-table";

export default function APITable() {
	const json =''
	
	fetch('http://example.com/movies.json')
  .then(response => response.json())
  .then(data => json);

  
  return (
	<JsonToTable json={json} />
  )
}
